import React from "react";

function Card (props) {

    return (
            <article className="element">
                <div className="element__contain">
                    <button className="element__trash" type="button">
                    </button>
                    <img className="element__image" alt="" src={props.link}/>
                    </div>
                <div className="element__description">
                    <h2 className="element__title">{props.name}</h2>
                    <div className="element__like-wrapper">
                        <button type="button" className="element__like">{'asd'}</button>
                        <span className="element__like-value">{props.likes.length}</span>
                    </div>
                </div>
            </article>
    )
}

export default Card;
